import React from 'react'
import { Link, NavLink } from "react-router-dom";
import {
  Navbar,
  NavItem,
  NavDropdown,
  MenuItem,
  Nav,
} from "react-bootstrap";
import { Button, Icon } from "@material-ui/core";
import { IoIosLogOut, IoMdRestaurant } from "react-icons/io";


function SignedInLink() {
    return (
      <Nav>
        <Nav.Link href="#deets">
          <Button variant="light">
            <IoMdRestaurant fontSize="large" />&nbsp;New Restaurant
          </Button>
        </Nav.Link>
        <Nav.Link href="#memes">
          <Button variant="light">
            <IoIosLogOut fontSize="large" />
            &nbsp;Log Out
          </Button>
        </Nav.Link>
        <Nav.Link href="#deets">
          <Navbar.Text>
            Signed in as: <a href="#lo gin">Mark Otto</a>
          </Navbar.Text>
        </Nav.Link>
      </Nav>
    );
}
 export default SignedInLink;
